import React, { useState } from "react";
import { Box } from "@mui/system";
import Paper from "@mui/material/Paper";

function UserList() {
  return (
    <Box
      sx={{
        color: "#2b627a",
        display: "flex",
        flexWrap: "wrap",
        "& > :not(style)": {
          m: 1,
          width: 800,
          height: 443,
        },
      }}
      position="relative"
      bottom="28.5rem"
      left="30rem"
    >
      <Paper />
    </Box>
  );
}

export default UserList;
